import React, {Component} from 'react';
import './Counter.css';

class Counter extends Component {

    constructor(props) {
        super(props);
    }

    render() {

        return (
            <div className="counter">
                Counter:
                <span className="value">
                    {this.props.initValue}
                </span>

            </div>
        );
    }
}

export default Counter; 

